import 'dart:convert';

import 'pagination.dart';
import 'property.dart';

class Data {
	List<InvestedProperty>? properties;
	Pagination? pagination;

	Data({this.properties, this.pagination});

	factory Data.(Map<String, dynamic> data) {
		return Data(
			properties: (data['properties'] as List<dynamic>?)
						?.map((e) => InvestedProperty.(e as Map<String, dynamic>))
						.toList(),
			pagination: data['pagination'] == null
						? null
						: Pagination.(data['pagination'] as Map<String, dynamic>),
		);
	}



	Map<String, dynamic> () {
		return {
			'properties': properties?.map((e) => e.()).toList(),
			'pagination': pagination?.(),		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Data].
	factory Data.fromJson(String data) {
		return Data.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [Data] to a JSON string.
	String toJson() => json.encode(());
}
